  [],\n\t\"revision_timestamp\": \"2016-07-27T23:04:34.243832\",\n\t\"name\": \"forest-management-plan-wertheim-national-wildlife-refuge-1989\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The forested areas of Wertheim National
  Wildlife Refuge (1,150 acres) are representative of a one to two mile wide band
  of oak-dominated forest that straddles much of the south shore of Long Island and
  is a component of the Long Island Pine Barrens region. Refuge forested stands are
  comprised almost exclusively of native flora, and as such, represent a natural resource
  that should be protected. This is an interim plan and has been prepared to satisfy
  administrative requirements, provide information and documentation pertaining to
  forested areas of the refuge, and serve as a management guideline. It will be replaced
  by a non-interim plan once refuge objectives are established.\",\n\t\"license_title\":
